module flipflop_carry_lookahead(output reg sum,
                                output cout,
                                input in1, in2, cin);

  reg [7:0] sum;
  reg cout;

  always @(in1 or in2 or cin)
  begin
    sum = in1 ^ in2 ^ cin;
    cout = (in1 ^ in2) & cin | (in1 & in2);
  end

endmodule

